import React from 'react';
import './Home.css';
const Home = () => {
	return (
       <>
       <div className="home-sec">
        <img className="intro-bg-pic" src="./Images/homebg.jpeg" alt="NITSMUN" />
        <div className="intro-logo">
                <img src="./Images/nitsmun.png" alt="" />
        </div>
       </div>
        
       </>
       )
}
export default Home
